import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Helmet} from "react-helmet";
import ContentLoader from "react-content-loader"
class App extends React.Component {
  logChangeClientState=()=>{
      console.log('logChangeClientState');
    }
    componentDidMount()
    {
       document.title = "dfsdfsdfsd"
       document.meta = "dfsdfsdfsd"
    }
  render()
  {
  return (
    <div>
    <Helmet
title="PlayFlix"
meta={[
{ name: 'author', content: "Fishii.shop" },

{ name: 'twitter:site', content: "Fishii.shop" },
{ name: 'twitter:creator', content: "Fishii.shop" },
{ name: 'twitter:title', content: post.title },
{ name: 'twitter:image', content: post.image },

{ property: 'og:title', content: post.title },
{ property: 'og:site_name', content: "Fishii.shop" },
{ property: 'og:type', content: "website" },
{ property: 'og:url', content: "http://fishii.shop/post/"+post.puid },
{ property: 'og:description', content: post.title },
{ property: 'og:image', content: post.image },
{ property: 'og:site_name', content: "Fishii.shop" },

{ name: 'viewport', content: 'width=device-width, maximum-scale=1' },
{ name: 'apple-itunes-app', content: 'app-id=1125423676' },
]}
/>
    <ContentLoader
    height={560}
    width={408}
    speed={2}
    primaryColor="#f3f3f3"
    secondaryColor="#ecebeb"
  >
    <rect x="0" y="15" rx="0" ry="0" width="117" height="16" />
    <rect x="70" y="35" rx="3" ry="3" width="85" height="6" />
    <rect x="0" y="80" rx="3" ry="3" width="350" height="6" />
    <rect x="0" y="100" rx="3" ry="3" width="380" height="6" />
    <rect x="0" y="120" rx="3" ry="3" width="201" height="6" />
  </ContentLoader>

  </div>
  );
}
}
export default App;
